import React from "react";

const ImageCode = (props) => {
  return (
    <div className="col-6 col-lg-3">
      <img
        src={props.name}
        alt="Imagen de logo ReactJS"
        className="img-fluid"
      />
    </div>
  );
};

export default ImageCode;
